('es-es', '_template', 'atutor_accessibility_text', '<p>ATutor incluye una serie de funcionalidades diseñadas para asegurar que el contenido sea accesible para todos los usuarios potenciales, incluyendo aquellos con conexiones a Internet lentas, navegadores viejos, y personas con discapacidades que empleen tecnologías asistivas para acceder a la Web.  Estas funcionalidades están descritas en detalle más abajo.</p>\r\n\r\n<ol>\r\n<li><strong>Enlaces de salto</strong>: En la esquina superior izquierda existen una serie de enlaces de salto que permiten a los usuarios de tecnología asistiva saltar los elementos de navegación convencional y dirigirse directamente al contenido que está siendo desplegado. Presione la tecla Tab (tabulador) una vez que se haya terminado de cargar la página para avanzar al primer enlace de salto; luego presione Enter para reposicionar el contenido en la parte superior de la pantalla. Alternativamente, los usuarios pueden presionar Tab dos veces y luego Enter para ir directo al menú principal. Presione la tecla Tab una tercera vez para saltar a la primera opción (Inicio) en la barra de navegación. Presione la tecla Tab por cuarta vez para saltar a la página de accesibilidad (esta página) para información sobre cómo configurar ATutor para trabajar eficazmente con tecnología asistiva.</li>\r\n\r\n<li><strong>Configuración de preferencias de accesibilidad por defecto</strong>:  ATutor tiene una configuración de accesibilidad por defecto que esconde todas las imágenes no esenciales para la navegación cuando está activada. <strong>Durante el registro</strong> Seleccione \"Activar el esquema de preferencias de accesibilidad\" para cargar la configuración de accesibilidad por defecto cuando entre a ATutor.  Esto elimina la mayoría de las imágenes de ATutor, y cierra el menú, dejando un par de enlaces de sequencia como herramienta de navegación principal. La configuración de accesibilidad también puede ser cargada seleccionando la opción <strong>Preferencia Preconfigurada</strong> \"<a href=\"tools/preferences.php?pref_id=1\">Accesibilidad</a>\" cerca de la parte superior de la página de preferencias. Se sugiere a los usuarios de lectores de pantalla que comiencen utilizando las configuraciones por defecto y luego modifiquen las preferencias (si fuera necesario). </li>\r\n\r\n<li><strong>Teclas de Acceso:</strong> La accesibilidad por teclado ha sido agregada a varias funcionalidades de ATutor. Para activar las teclas de acceso, presione Alt+ el numero asignado o letra como sigue:\r\n<ul>\r\n<li>[Alt 1] Inicio</li>\r\n<li>[Alt 2] Herramientas</li>\r\n<li>[Alt 3] Recursos</li>\r\n<li>[Alt 4] Foros</li>\r\n<li>[Alt 5] Ayuda</li>\r\n<li>[Alt 6] Plegar y desplegar menúes</li>\r\n<li>[Alt 7] Menu Global</li>\r\n<li>[Alt 8] Tema Anterior </li>\r\n<li>[Alt 9] Próximo Tema</li>\r\n<li>[Alt 0] Resumen</li>\r\n<li>[Alt y] Navegación principal</li>\r\n<li>[Alt m] Menúes</li>\r\n<li>[Alt j] Ir al Menú</li>\r\n<li>[Alt s] Enviar (activo en las páginas con formularios)</li>\r\n<li>[Alt c] Saltar a la parte superior  del contenido (enlace de desvío</li>\r\n</ul>\r\n </li>\r\n<li><strong>Texto Alternativo:</strong> Todas las imágenes en ATutor incluyen un texto alternativo que describe la imagen o su función.</li>\r\n<li><strong>Navegación Alternativa:</strong> Las herramientas de navegación global, jerárquica, y secuencial están disponibles de forma que los usuarios puedan visualizar o estructurar el contenido en la manera que mejor se adapte a su estilo de aprendizaje.  Vea las páginas de Ayuda o el curso Cómo Usar ATutor para más información sobre las funcionalidades de navegación.</li>\r\n<li><strong>Esconder Menúes:</strong> Para los usuarios con tecnología asistiva anticuada que no soportan texto en columnas dentro de tablas, es posible esconder los menúes para que el contenido sea desplegado de forma lineal. Eliminar los menúes ayuda a obtener mayor espacio en pantalla para los usuarios con monitores pequeños.</li>\r\n<li><strong>Texto o Imágenes:</strong> Los usuarios de ATutor pueden elegir desplegar las funcionalidades de navegación en forma de texto, iconos, o texto e iconos a través de la configuración de preferencias.</li>\r\n<li><strong>Rótulos en los Formularios:</strong> Todos los campos de formularios están marcados usando el elemento LABEL para asegurar que estén descritos adecuadamente para los usuarios de tecnología asistiva.  El rotulado realizado de esta manera también permite hacer click en el rótulo de un formulario para activar el campo.  Esto provee un área de selección mayor para aquellas personas que tiene problemas posicionando el ratón en un campo pequeño de formulario como por ejemplo un botón de selección múltiple.</li>\r\n<li><strong>Hojas de Estilo:</strong> En la medida de lo posible, la presentación del contenido en ATutor es controlada por elementos de hojas de estilo.  Esto permite a los usuarios modificar la apariencia por defecto de ATutor y aplicar sus propias preferencias de estilo (por ejemplo, incrementar el tamaño de las fuentes, cambiar la tipografía, colores, etc.)</li>\r\n<li><strong>Enfoque de campos de formulario:</strong> Para páginas donde el contenido principal es un formulario, el cursor del ratón se colocará automáticamente en el primer campo de forma que después de que el formulario sea cargado, no sea neceario hacer click o desplazar el tabulador a un campo.  El usuario puede comenzar a digitar el texto en el formulario tan pronto como la página termine de cargar.</li> <li><strong>Tamaño relativo de las imágenes:</strong> [Nuevo en V1.3] en los navegadores que permiten el ajuste del tamaño de las imágenes, los íconos de ATutor pueden ser magnificados para usuarios con poca visión, haciéndolos más fácilmente visibles (e.g. en Netscape 7 presionar Alt +) </li> </ol>', '2009-12-11 14:02:42', ''),
