('es-es', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> es un <strong>Sistema de Gestión de Contenidos de Aprendizaje - Learning Content Management System (LCMS)</strong> de Código Abierto basado en la Web y diseñado con el objetivo de lograr accesibilidad y adaptabilidad. Los administradores pueden instalar o actualizar ATutor en minutos. Los educadores pueden rápidamente ensamblar, empaquetar y redistibuir contenido educativo, y llevar a cabo sus clases online. Los estudiantes pueden aprender en un entorno de aprendizaje adaptativo.', '2009-12-11 13:57:28', ''),
('es-es', '_template', 'atutor_links', '<p>Conozca <a href=\"http://atutor.ca/index.php\">ATutor</a> navegando los siguientes\r\nenlaces: </p>\r\n<ul>\r\n  <li><a href=\"http://www.atutor.ca/howto.php\">Curso \"Cómo hacer\" en ATutor</a> -\r\n    Aprenda a usar ATutor en este curso instructivo </li>\r\n  <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - Preguntas frecuentes\r\n    y sus respuestas</li>\r\n  <li><a href=\"http://atutor.ca/forums/index.php\">Foros de soporte</a> - Publicar\r\n    un mensaje en los foros de usuarios</li>\r\n  <li><a href=\"http://atutor.ca/services/index.php\">Servicios de Soporte</a> -\r\n    Si necesita nuestra ayuda, hay soporte disponible</li>\r\n  <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Traducción</a> -\r\n    Descargue paquetes de idiomas, sea traductor</li>\r\n  <li><a href=\"http://atutor.ca/services/licensing.php\">Licencias</a> -\r\n    ATutor está disponible gratuitamente bajo determinados términos</li>\r\n  <li><a href=\"http://atutor.ca/atutor/download.php\">Descargar ATutor</a> - Todo\r\n    el software necesario para instalar ATutor puede ser descargado desde aquí</li>\r\n</ul>', '2009-12-10 16:10:08', ''),
