('es-es', '_template', 'chat_help_display_blurb', '<p>Nota: Los enlaces <em>Ir a</em> y la lista <em>Teclas de acceso rápido</em> sólo aparecen si usted ha seleccionado el empleo de las <em>Ayudas de Navegación</em> en sus preferencias.</p> <ul> <li>El enlace <em>Ir a Teclas de Acceso Rápido</em> en la parte superior lo lleva a una lista de teclas de acceso rápido para el Chat. </li> <li>El <em>Área de Mensajes</em> despliega los mensajes más recientes (hasta 10). </li> <li>El enlace  <em>Saltar a Mensajes</em> lo lleva al inicio de la lista de mensajes. (Alt+M) </li> <li>El enlace de <em>Actualizar Mensajes</em> le permite verificar si hay nuevos mensajes (Alt+R). </li> <li>Los campos <em>Redactar Mensajes</em> y <em>Botón Enviar</em> le permiten ingresar y enviar mensajes (Alt+C para ingresar al Campo de Redactar, Enter para enviar un mensaje terminado). </li> </ul>', '2004-08-20 13:17:16', ''),
