('es-es', '_template', 'import_lang_howto', 'Después de descargar un nuevo Idioma desde el Sitio Web de Atutor.ca, utilice el botón del navegador para localizarlo en el sistema de archivos de su ordenador, presione \"Importar\" para descargar el archivo e instalarlo en ATutor. (Nota: Los archivos de idioma pueden requerir de cierto tiempo para ser importados, dependiendo de la velocidad de conexión a Internet que disponga, y la potencia de su servidor Web. Por favor, tenga paciencia.)', '2009-12-11 10:25:17', ''),
